import React, { useEffect } from "react";

export default function Script() {
    useEffect(()=> {
        const scripts = [
            fetch("../scripts/webflow.js").then(body => body.text()),
          ]
          try {
            scripts.concat(Promise.resolve()).reduce((loaded, loading) => {
              return loaded.then((script) => {
                  console.log('Loaded');
                new Function(`
                  with (this) {
                    eval(arguments[0])
                  }
                `).call(window, script)
        
                return loading
              })
            })
          } catch (error) {
            console.log(error)
            return true;
          }
  })
}
